

SET SQL_SAFE_UPDATES=0;
UPDATE Cart_Product_List
SET cp_price = (
	SELECT p_cost * cp_quantity
	FROM Product
	WHERE Product.p_id = Cart_Product_List.cp_pid
);

UPDATE Cart
SET total_price = (
    SELECT SUM(cp_price)
    FROM Cart_Product_List
    WHERE cp_cart_id = Cart.cart_id
);
SET SQL_SAFE_UPDATES=1;